public static Method getMethod(String method) {
  method = method.toUpperCase().intern();

  for (Method m : Method.values()) {
    // we can use == because we interned the String objects
    if (m.method==method) {
      return m;
    }
  }

  return OTHER;
}

public static Method getMethod(String method) {
  try {
    return Method.valueOf(method.toUpperCase());
  } catch (Exception e) {
    return OTHER;
  }
}

